import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import QuizPage from './pages/QuizPage'; // Import the QuizPage
import ResultPage from './pages/ResultPage'; // Import the ResultPage
import HomePage from './pages/HomePage'; // Assuming you have a HomePage component

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} /> {/* HomePage route */}
        <Route path="/quiz/:id" element={<QuizPage />} /> {/* QuizPage route */}
        <Route path="/result" element={<ResultPage />} /> {/* ResultPage route */}
      </Routes>
    </Router>
  );
};

export default App;
